import requests
from rest_framework import status
from django.urls import reverse
from rest_framework.test import APITestCase
from rest_framework.authtoken.models import Token
from django.contrib.auth import get_user_model
from django.test import TestCase
from rest_framework.test import APIClient

CHEL = {
    "username": "bob",
    "first_name": "string",
    "last_name": "string",
    "email": "normal@user.com",
    "password": "foo"
}

AVA = {
    "avatar": "data:image/jpeg;base64,"
}


class UsersManagersTests(TestCase):

    def test_create_user(self):
        User = get_user_model()
        user = User.objects.create_user(**CHEL)
        self.assertEqual(user.email, "normal@user.com")
        self.assertEqual(user.username, "bob")
        self.assertTrue(user.is_active)
        self.assertFalse(user.is_staff)
        self.assertFalse(user.is_superuser)

        with self.assertRaises(TypeError):
            User.objects.create_user()
        with self.assertRaises(TypeError):
            User.objects.create_user(email="")
        with self.assertRaises(TypeError):
            User.objects.create_user(email="", password="foo")
        with self.assertRaises(ValueError):
            User.objects.create_user(
                email="normal@user.com", username="", password="foo")

    def test_create_superuser(self):
        User = get_user_model()
        admin_user = User.objects.create_superuser(**CHEL)
        self.assertEqual(admin_user.email, "normal@user.com")
        self.assertEqual(admin_user.username, "bob")
        self.assertTrue(admin_user.is_active)
        self.assertTrue(admin_user.is_staff)
        self.assertTrue(admin_user.is_superuser)

        with self.assertRaises(ValueError):
            User.objects.create_superuser(
                email="normal@user.com",
                username="bob",
                password="foo",
                is_superuser=False)

    def test_token_authentication(self):
        User = get_user_model()
        user = User.objects.create_user(**CHEL)

        client = APIClient()
        response = client.post(
            '/api/v1/auth/token/login/', CHEL)
        self.assertEqual(response.status_code, 200)
        token = response.data['token']

        client.credentials(HTTP_AUTHORIZATION=f'Token {token}')
        response = client.get('/api/v1/users/me/')
        self.assertEqual(response.status_code, 200)
        self.assertEqual(response.data['email'], 'normal@user.com')
        self.assertEqual(response.data['username'], 'bob')

    def test_ava(self):
        User = get_user_model()
        user = User.objects.create_user(**CHEL)

        client = APIClient()
        response = client.post(
            '/api/v1/auth/token/login/', CHEL)
        self.assertEqual(response.status_code, 200)

        token = response.data['token']
        client.credentials(HTTP_AUTHORIZATION=f'Token {token}')

        response = client.put(
            '/api/v1/users/me/avatar/', AVA)
        self.assertEqual(response.status_code, 200)

        response = client.get('/api/v1/users/me/')
        self.assertEqual(response.status_code, 200)


class LogoutViewTest(APITestCase):
    def setUp(self):
        User = get_user_model()
        self.user = User.objects.create_user(**CHEL)
        self.token = Token.objects.create(user=self.user)
        self.client.credentials(HTTP_AUTHORIZATION=f'Token {self.token.key}')

    def test_logout(self):
        url = reverse('token_logout')
        response = self.client.post(url)
        self.assertEqual(response.status_code, status.HTTP_204_NO_CONTENT)

        # Проверяем, что токен был удален
        self.assertFalse(Token.objects.filter(user=self.user).exists())
